import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OnePet = props => {
    const [onePet, setOnePet] = useState({});

    useEffect(() => {
        axios.get(`http://localhost:8000/api/pets/${props._id}`)
            .then()
    })

    return(
        <div>
            Pet Page for ${props._id}
        </div>
    )
}

export default OnePet;
